Based on the outcomes from multiple studies, further discussed below, and our deep experience in the field of bunion surgery, we believe the key advantages of the Lapiplasty System include the system being designed for:
•consistent 3D deformity correction;
•addressing root cause of the deformity;
•ease and reproducibility of the procedure;
•fast return to weight-bearing post-surgery in a walking boot;
•slimmer foot (post 5-month follow up); and •low rate of recurrence (as demonstrated across three separate studies which measured recurrence rates at different time points after the Lapiplasty Procedure: 0.9% at 12 months, 3.2% at 13 months, and 0.9% at 17 months).

•accelerate growth and better penetrate the market with our products;
•further align incentives and allow for improved coordination of our sales team; and
•improve profitability with better operating leverage in the longer term. We believe our surgeon education and training programs differentiate us from our competitors. We devote significant resources to training and educating physicians on the safe and effective use of the Lapiplasty System. Our comprehensive education programs include cadaveric workshops, technical assistance in the operating room and advanced training for both new and existing surgeon customers. We believe our multiple post-market clinical outcome studies are also unique in the bunion correction field and are a key element of our medical education program.

Post-Market Regulation
After a device is cleared or approved for marketing, numerous and pervasive regulatory requirements continue to apply. These include:
•establishment registration and device listing with the FDA;
•QSR requirements, which require manufacturers, including third-party manufacturers, to follow stringent design, testing, control, documentation and other quality assurance procedures during all aspects of the design and manufacturing process;
•labeling regulations and FDA prohibitions against the promotion of investigational products, or the promotion of "off-label" uses of cleared or approved products;
•requirements related to promotional activities; •clearance or approval of product modifications to 510(k)-cleared devices that could significantly affect safety or effectiveness or that would constitute a major change in intended use of one of our cleared devices, or approval of certain modifications to PMA-approved devices;

The FDA has broad regulatory compliance and enforcement powers. If the FDA determines that a manufacturer has failed to comply with applicable regulatory requirements, it can take a variety of compliance or enforcement actions, which may result in any of the following sanctions:
•warning letters, untitled letters, fines, injunctions, consent decrees and civil penalties;
•recalls, withdrawals, or administrative detention or seizure of our products;
•operating restrictions or partial suspension or total shutdown of production;
•refusing or delaying requests for 510(k) marketing clearance or PMA approvals of new products or modified products;
•withdrawing 510(k) clearances or PMA approvals that have already been granted;
•refusal to grant export approvals for our products; or
•civil or criminal prosecution.
Coverage and Reimbursement In the United States, our currently approved products are commonly treated as general supplies utilized in orthopaedic surgery and if covered by third-party payors, are paid for as part of the surgical procedure. Outside of the United States, there are many reimbursement programs through private payors as well as government programs. In some countries, government reimbursement is the predominant program available to patients and hospitals. Our commercial success depends in part on the extent to which governmental authorities, private health insurers and other third-party payors provide coverage for and establish adequate reimbursement levels for the procedures during which our products are used. Failure by physicians, hospitals, ambulatory surgery centers and other users of our products to obtain sufficient coverage and reimbursement from third-party payors for procedures in which our products are used, or adverse changes in government and private third-party payor's coverage and reimbursement policies could materially adversely affect our business, financial condition, results of operations and prospects.

