Also, since the Lapiplasty Procedure, including the minimally invasive variations, and the Adductoplasty Procedure, are relatively new procedures, some surgeons may be reluctant to change their surgical treatment practices for the following reasons, among others:
•lack of experience with our products and procedures;
•existing relationships with competitors and distributors that sell competitive products;
•lack or perceived lack of evidence supporting additional patient benefits;
•perceived liability risks generally associated with the use of new products and procedures;
•less attractive availability of coverage and reimbursement by third-party payors compared to procedures using competitive products and other techniques;
•costs associated with the purchase of new products and equipment; and
•the time commitment that may be required for training.
These reasons may affect the pace of adoption of the Lapiplasty and Adductoplasty Procedures and future products and techniques that we may offer. In addition, we believe recommendations and support of our products and technologies by influential surgeons and key opinion leaders in our industry are essential for market acceptance and establishment of our products and procedures as a standard of care. If we do not continue to receive support from such surgeons and key opinion leaders, if long-term data does not continue to show the benefits of using our products and procedures, or if the benefits offered by our products and procedures are no longer deemed sufficient to justify their cost, surgeons, hospitals and other health care facilities may not use or continue to use our products, and we might be unable to continue to establish our products and procedures as a standard of care and continue to achieve market acceptance.

