Risks Related to Ownership of Our Common Stock
The market price of our common stock may be volatile and fluctuate substantially.
The market price of our common stock may be highly volatile and could fluctuate or decline substantially as a result of a variety of factors, some of which are beyond our control or are related in complex ways, including:
•actual or anticipated fluctuations in our financial condition and results of operations;
•the financial projections we may provide to the public, any changes in these projections or our failure to meet these projections;
•the success of existing or new competitive products or technologies;
•regulatory or legal developments in the United States and other countries;
•developments or disputes concerning patent applications, issued patents or other proprietary rights;
•changes in analysts' estimates, investors' perceptions, recommendations by securities analysts or our failure to achieve analysts' estimates;
•sales of our common stock by us, our insiders, or other stockholders as well as the anticipation of expiration of market standoff or lock-up releases;
•delays or setbacks in the ongoing commercialization of our Lapiplasty System and other products;
•changes in the structure of health care payment systems;
•the recruitment or departure of key personnel;
•the commencement of litigation or governmental investigations;
•announcement or expectation of additional financing efforts;
•the trading volume of our common stock;
•the impact of COVID-19 or other pandemics on the performance of elective procedures;
•market conditions in the medical device sectors;
•the seasonality of our business;
•an increase in the rate of returns of our Lapiplasty System kits or an increase in warranty claims;
•general economic, industry and market conditions; and
•the other factors described in this "Risk Factors" section. In recent years, the stock market in general, and the market for medical device companies in particular, has experienced significant price and volume fluctuations that have often been unrelated or disproportionate to changes in the operating performance of the companies whose stock is experiencing those price and volume fluctuations. Further, the stock market in general has been highly volatile due to inflation, interest rate increases, supply chain disruptions, general economic conditions, and the COVID-19 pandemic in the United States. Broad market and industry factors may seriously affect the market price of our common stock, regardless of our actual operating performance. These fluctuations may be even more pronounced in the trading market for our stock in the early years after our initial public offering. Following periods of such volatility in the market price of a company's securities, securities class action litigation has often been brought against that company. Because of the potential volatility of our stock price, we may become the target of securities litigation in the future. Securities litigation could result in substantial costs and divert management's attention and resources from our business.

